By implementing World as an interface, it can be extended in projects by using declaration merging.

Example:

```ts
import {defineSupportCode} from "cucumber";

declare module "cucumber" {
    interface World {
        cleanup: Function[];
    }
}

defineSupportCode(function({After, Before}) {
	Before(function() {
		this.cleanup = [];
	})

	After(function() {
		while (this.cleanup.length > 0) {
			const job = this.cleanup.shift()!;
			job();
		}
	});
});
```

Now world property `cleanup` will be checked and autocompleted in all step definitions.

Previously the definition defined an interface globally, the used:
```ts
declare var async: Async;
declare module "async" { export = async; }
```

Now, we simply export the members of the `Async` interface directly as functions.
